import "./countryCard.css";
import { Link } from "react-router-dom";
function CountryCards(props) {
  return (
    <>
      {props.countries && (
        <div className="card-container">
          {props.countries.map((country) => (
            <div key={country.cca2} className="card">
              
            </div>
          ))}
        </div>
      )}
    </>
  );
}
export default CountryCards;
